Today I want to share with you one of the best and most powerful things I have EVER done for myself to heal and changeâ¤ï¸ğŸŒŸ.

I have not told you before, but I am currently on a journey of healing and transformation. I started this journey five years ago, wanting to evolve into a new and more fulfilled version of me. One year ago I decided - after a few years with setbacks and little progress in healing - to quit my career job in the Danish government administration to pursue my long time dream of starting my own business helping other women to become more confident and fulfilled. So I chose to FOLLOW MY PASSION. Despite the financial uncertainty. Despite being a solo mom. And despite dealing with anxiety and stress. 

Not only did I choose to follow my passion, I did also choose to LET GO. I let go of beliefs and ambitions that were never really mine. I let go of my need to control things. And I let go of the need for people and things that were NOT serving my highest good. 

This combination of working with my passion project and letting go of people and things that were not good for me has worked miraculously well for me. I do not suffer from stress anymore. I am happier and healthier than I have been for many years. And I have developed a much closer relationship with my childrenâ™¥ï¸â™¥ï¸â™¥ï¸. 

Have you tried the magic of following your passion and letting go of what you do not needâ¤ï¸ğŸ’«? 

